// copy text to clipboard
function copyText(el) {
    // Get the text field
    var copyText = document.getElementById(el);
    var text = copyText.innerText;
  
    // Copy the text inside the text field
    navigator.clipboard.writeText(text);
    
    // show copid response bove tooltip
    var tooltip = document.getElementById("tooltip").style;
    tooltip.opacity = 1;
    (function fade(){(tooltip.opacity-=.1)<0?tooltip.opacity="0":setTimeout(fade,80)})();
}

// define api url and key
let api_url = "https://api.simpleswap.io/";
let api_key = "api_key=0f27dace-0407-4c26-8d93-51bc7939f892";

// function for calling simpleswap api
async function  fetchApi(url, options) {
    let response = await fetch(url, options); 
    if (response.ok) { 
        const result = await response.json();                
        return result;      
    } else {
        var swapbox = document.getElementById("swapbox");
        swapbox.innerHTML =  "Simple swap error: " + response.status + 
        "<br />Please check back later to donate other currencies";    
    };   
};

