function procede(quantity, currency) {
    document.getElementById("confirm-swapbox").style.display = "none";

        // clear the container and add loading animation
        var container=document.getElementById("swapbox");
        container.style.display = "block";
        container.innerHTML =   '<div class="psoload">'+
                                '<div class="straight"></div>'+
                                '<div class="curve"></div>'+
                                '<div class="center"></div>'+
                                '<div class="inner"></div>'+
                                '</div>'; 
                                   
        // Time to create the exchange
        createExchange(quantity, currency);
}

// the swap was canceled
function noswap(){
    var confirmswapbox = document.getElementById("confirm-swapbox");
    confirmswapbox.style.display = "none";
    document.getElementById("swapbox").style.display = "block";
    confirmswapbox.innerHTML = "";
}

// sanitize then conirm they want to procede
function generate() {
    // get the values from the feilds
    var currency=document.getElementById("currency").value;
    var raw_quantity=document.getElementById("quantity").value;

    // strip leading zeros and whitespace
    quantity = Number(raw_quantity.trim());

    // if not a number, dont let it go through
    if(!isFinite(quantity) || quantity == ''){
        alert("Quantity MUST be a decimal number")
        return
    };

    // switch the swapboxes
    document.getElementById("swapbox").style.display = "none";
    var confirmswapbox = document.getElementById("confirm-swapbox");
    confirmswapbox.style.display = "block";

    // Make sure they want to procede
    confirmswapbox.innerHTML = "<h3>Do you want to proceed?</h3>"+
    "<p>By clicking YES, a one-time use deposit address will be created on <b>SimpleSwap</b> to auto exchange " +
    "<span style=\"font-weight:600;color: #ffbd30;\">" + quantity + " " + currency.toUpperCase() + 
    "</span> to the Pirate Chain ARRR donation address</p>"

    let yesbtn = document.createElement("button");
    yesbtn.innerHTML = "YES";
    yesbtn.style.backgroundColor="#00ff00"
    yesbtn.onclick = function () {
        procede(quantity,currency);
    };
    confirmswapbox.appendChild(yesbtn);

    let nobtn = document.createElement("button");
    nobtn.innerHTML = "NO";
    nobtn.style.backgroundColor="#fd0e35"
    nobtn.onclick = function () {
        noswap();
    };
    confirmswapbox.appendChild(nobtn);
};


