    // get the trading pairs and sort them
    var url = api_url + "get_pairs?" + api_key + "&fixed=false&symbol=arrr";
    let pair_list = await fetchApi(url, {
        method: "GET",
        headers: {"Content-type": "application/json", "accept": "application/json"}
    });
    const pairs = pair_list.sort();
    
    // Remove existing options
    var dropdown = document.getElementById("currency");
    Array.from(dropdown).forEach((option) => {
        dropdown.removeChild(option)
    })

    //build the options and append to existing dropdown menu
    for (index = 0; index < pairs.length; index++)
    {
        var opt = document.createElement('option')
        let symbol = pairs[index]; 

        // if the currency is in the pair list, get its name        
        let currency = currencies.find(o => o.symbol === symbol)
        console.log(currency);

        // if its not, just use the symbol
        if (typeof currency === "undefined") {
            currency = {};
            currency['name'] = symbol;
        };      
        
        // create option text and append
        var option = symbol.toUpperCase() + ' | ' + currency['name']
        opt.appendChild(document.createTextNode(option));
        opt.value = symbol;
        dropdown.appendChild(opt);
    }

    // lets set BTC as the default selected pair, and add a id
    dropdown.querySelector('option[value=btc]').setAttribute('selected', true)          
